import React, { useEffect } from 'react';
import './SearchPage.css';
import Header from '../Header/Header';
// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
// import { faArrowLeft } from '@fortawesome/free-solid-svg-icons';
import { Link } from 'react-router-dom';
import { useGetFriends } from '../Hooks/connectionHook';

const SearchPage = () => {
  const {friends ,  getFriends} = useGetFriends()

  useEffect(()=>{
    getFriends();
  },[friends]) ;




  const url ="data:image/jpeg;base64,"

  return (
    <div className="search-page">
      <Header />
      <div className="search">
        {/* <input type="text" placeholder="Search..." onChange={(e)=>{setFilter(e.target.value)}} className='search-placeholder'/>
        <button className='search-button' onClick={clickHandler}><FontAwesomeIcon icon={faArrowLeft} /></button> */}

        {
          friends ? (<div className="alluser" >  
            {
              friends?.connectedUserDetails.map(user => (
                <Link to={`/chat/${user?._id}`}>
                <div className='alluser-1' >
                <img src={url} alt="" key={user?._id} />
                <div className="alluser-name">{user?.name}</div>
                </div >
                </Link>
              ))
            }
          </div>) : ( <div> no user found </div> )
        }
      </div>
    </div>
  );
};

export default SearchPage;
